import React from "react";
import Card from "./Card";
import Frame from "../UI/Frame";

const CardExpenses = (props) => {
  return (
    <Frame className="expenses">
    {props.card.map((cards) => (
      <Card
        date={cards.date}
        name={cards.title}
        cost={cards.amount}
      />
      ))}
    </Frame>
  );
};

export default CardExpenses;
